        <input id="" className="start__input" type="email" placeholder="Email" />
        <input id="" className="start__input" type="password" placeholder="Пароль" />
        <button className="start__button" type="submit" onClick = {props.submitButton}>{props.textButton}</button>
      </form>
      {props.children}
    </div>
  );
}

export default Start;
